class HomePage extends React.Component{

    constructor(props) {
        super(props);
        this.state= {
            data: ["£"]
        }
    }

    fetchData() {
        var dataFetch = fetch("http://127.0.0.1:5000/data")
              .then((response) => response.json())
              .then((data) => console.log(data));

              this.setState({
                data: ["1", "2"]
            });

            }


    render() {
        return (
        <div className="HomePage">
        <h1>Home Page Information</h1>
        <h2>{this.state.data[0]}</h2>
        <button onClick={this.fetchData}>Press</button>
        </div>

        );
    }
}


export default HomePage;
